    d = []
    while N >= 0:
        d.append(N % 2)
        N //= 2
    e = []
    while M > 0:
        e.append(M % 2)
        M //= 2
    a1 = {}
    for i in range(len(d)):
        s = ''
        for j in range(i, len(d)):
            s += str(d[j])
            a1[s] = 1
    res = 0
    c2 = 0
    for i in range(len(e)):
        s = ''
        c1 = 0
        c = 0
        p = 1
        for j in range(i, len(e)):
            c += p * e[j]
            p *= 2
            s += str(e[j])
            c1 += 1
            if s in a1:
                if c1 > c2:
                    res = c
                    c2 = c1
                elif c1 == c2:
                    res = max(res, c)
    return res

